document:
La función de transferencia de perfiles se incluye en tu cuenta. Si no quieres habilitar esta función en tu cuenta, sigue estas instrucciones para desactivar las transferencias de perfiles.
Un perfil puede transferirse siempre que:
esté en una cuenta activa;
no sea un perfil de Niños;
no esté protegido por PIN (si tiene un PIN, quítalo y luego haz la transferencia);
